                .footer__dropdown-menu-about, .footer__dropdown-menu-nav, .footer__dropdown-menu-support {
                    z-index: 1;
                    background-color: rgba(255, 255, 255, 0.95);
                    position:absolute;
                    text-align:center;
                    top:-5px;
                    left:150px;
                    visibility: hidden;
                    overflow:hidden;
                    -webkit-transition:max-width 0.3s linear;
                    -moz-transition:max-width 0.3s linear;
                    transition:max-width 0.3s linear;
                    li:hover {
                        font-weight: 800;
                    }
                    li {
                        margin: 0;
                        padding: 15px 80px;
                        border: 1px solid;
                        border-color: rgba(255, 255, 255, 0.95) rgba(255, 255, 255, 0.95) rgba(31, 32, 65, 0.212) rgba(255, 255, 255, 0.95);
                        &:last-child {
                            border-color: rgba(255, 255, 255, 0.95);
                        }
                    }   
                    a {
                        color: rgba(31, 32, 65, 0.5);
                    }
                }
                .footer__dropdown-menu-about.footer__dropdown-menu-open, .footer__dropdown-menu-nav.footer__dropdown-menu-open, .footer__dropdown-menu-support.footer__dropdown-menu-open {
                    visibility: visible;
                }
            }
        }
        .column-2__footer {
            .footer__dropdown-about {
                .footer__dropdown-menu-about {
                    left:150px;
                    top: -20px;
                }
            }
        }
        .column-3__footer {
            .footer__dropdown-nav {
                .footer__dropdown-menu-nav {
                    left:150px;
                    top: -70px;
                }
            }
        }
        .column-4__footer {
            .footer__dropdown-support {
                .footer__dropdown-menu-support {
                    left:150px;
                    top: -125px;
                    li {
                        &:last-child {
                            padding-bottom: 40px;
                        }
                    }
                }
            }
        }
    }
    .footer__responsive-columns {
        display: none;
    }
    .column-1__footer-850px {
        display: none;
    }
}


.bottom__footer {
    padding-top: 13px;
    .wrap {
        display: flex;
        justify-content: space-between;
    }
    color: rgba(31, 32, 65, 0.75);
    .social {
        width: 112px;
        display: flex;
        justify-content: space-between;
        .btn-social {
            background-image: url(../img/btn-social.svg);
            background-repeat: no-repeat;
            &:hover {
                opacity: 0.75;
            }
            &:focus {
                opacity: 0.95;
            }
        }
        .btn-tw {
            background-position: -1px 10px;
            width: 24px;
        }
        
