            margin-right: 3.5px;
            margin-top: 4px;
        }
    }
    .reviews-room__comment {
        display: flex;
    }
    .reviews-room__comment-avatar {
        position: absolute;
        left: -20px;
        top: -1.5px;
    }
    .reviews-room__comment-like {
        display: flex;
        margin-top: 64px;
        border-radius: 10px;
        width: 32px;
        height: 12px;
